import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

export default function RoomIcon() {
    return (
        <View style={styles.RoomIconContainer}>
        </View>
    )
}

const styles = StyleSheet.create({
    RoomIconContainer: {
        margin: 5,
        backgroundColor: '#000',
        borderRadius: 25,
        minWidth: 60,
        minHeight: 60,
        maxWidth: 60,
        maxHeight: 50,
        zIndex: 200
    }
})
